import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

import NavBar from "./shared/components/NavBar";
import Accueil from "./pages/Accueil";
import DeroulementStagesEmp from "./pages/DeroulementStagesEmp";
import ProfilsCompetences from "./pages/ProfilsCompetences";
import DeroulementStagesEtu from "./pages/DeroulementStagesEtu";
import FAQ from "./pages/FAQ";

const App = () => {
  return (
    <Router>
      <NavBar />
      <Routes>
        <Route path="/" exact element={<Accueil />} />
        <Route path="/PagesInformativesDeroulementStagesEmp" exact element={<DeroulementStagesEmp />} />

        <Route path="/ProfilsCompetences" exact element={<ProfilsCompetences />} />
        <Route path="/DeroulementStagesEtu" exact element={<DeroulementStagesEtu />} />
        <Route path="/FAQ" exact element={<FAQ />} />
      </Routes>
    </Router>
  );
};

export default App;
